import React from 'react';
import Box from '@mui/material/Box';

//함수선언
// 팔로잉 추가
// 팔로잉 삭제



export default function Following() {
    return (
        <Box 
        sx={{ width: '98%', bgcolor: 'background.paper' }} 
        textAlign='center' 
        style={{ margin : 5, position:'relative'}}>
            <p>Following</p>
        </Box>
    )
}
